import React from 'react';
import './Contact.scss';
import emailjs from 'emailjs-com';
import phone from '../../assets/mobile.png';
import mail from '../../assets/mail.png';

export default function Contact() {

    function sendEmail(e) {
        e.preventDefault();

        emailjs.sendForm('gmail', 'template_uj75mwg', e.target, 'YOUR_USER_ID')
          .then((result) => {
              console.log(result.text);
          }, (error) => {
              console.log(error.text);
          });
      }

    return (
        <div class="background">
            <div class="contact-container">
                <div class="contact-left">
                    <h2>get in touch!</h2>
                    <form class="contact-form" onSubmit={sendEmail}>
                    <div class="multiple-row">
                        <input type="text" placeholder="Name" class="form-in"/>
                        <input type="email" placeholder="Email" class="form-in"/>
                        <textarea placeholder="Your Message" class="form-in"></textarea>
                        <input type="submit" id="submit"/><label for="submit">submit<i class="fas fa-paper-plane"></i></label>
                    </div>

                    </form>
                </div>
                <div class="contact-right">
                    <h2>contact information</h2>
                    <div class="contact-info">
                    <p><i class="fas fa-phone-alt"></i> +46 70 814 3753 </p>
                    <p><i class="fas fa-envelope"></i> kordiz@berkeley.edu </p>
                    <p><i class="fas fa-map-marker-alt"></i> Currently located in Stockholm, Sweden</p>
                    </div>

                    <div class="social-links">
                    <a href="#"><i class="fab fa-facebook"></i></a>
                    <a href="#"><i class="fab fa-instagram"></i></a>
                    <a href="#"><i class="fab fa-linkedin"></i></a>
                    <a href="#"><i class="fab fa-youtube"></i></a>
                    </div>
                </div>
            </div>
        </div>



    );
}
